    public static void cargarEMC_ADMONCOMBOS(){
        emc_admoncombos tmAD;
        tmAD = new emc_admoncombos("1", "select EST_IDESTADO as  id, est_nombreestado as descripcion from gic_estado");
        tmAD.save();

        tmAD = new emc_admoncombos("3", "SELECT PERIDPERFIL AS ID, PERNOMBREPERFIL AS DESCRIPCION " +
                "FROM EMCPERFIL PE " +
                "JOIN EMCESTADO ES ON ES.ESTIDESTADO = PE.ESTIDESTADO " +
                "WHERE TRIM(ES.ESTNOMBREESTADO)='ACTIVO'");
        tmAD.save();

        tmAD = new emc_admoncombos("2",	"select entidentidad as id,entnombreentidad as descripcion" +
                "from EMCENTIDAD en" +
                "join EMCESTADO es on es.estidestado = en.estidestado" +
                "where trim(es.estnombreestado)='ACTIVO'");
        tmAD.save();

        tmAD = new emc_admoncombos("6", "select T.IDDEPTO RESIDRESPUESTA, T.NOMDEPTO RESRESPUESTA FROM EMCDEPARTAMENTO T ORDER BY T.IDDEPTO");
        tmAD.save();

        tmAD = new emc_admoncombos("4", "select T.IDDEPTO Id, T.NOMDEPTO Descripcion FROM EMCDEPARTAMENTO T ORDER BY T.NOMDEPTO");
        tmAD.save();

        tmAD = new emc_admoncombos("5", "SELECT PERIDPERFIL AS ID, PERNOMBREPERFIL AS DESCRIPCION " +
                "FROM EMCPERFIL PE " +
                "JOIN EMCESTADO ES ON ES.ESTIDESTADO = PE.ESTIDESTADO " +
                "WHERE ( PERTIPOPERFIL <> 1) AND TRIM(ES.ESTNOMBREESTADO) = 'ACTIVO'");
        tmAD.save();

        tmAD = new emc_admoncombos("7", "Select tipCortoDoc as ID , tipNombreDoc AS DESCRIPCION FROM EMCTIPODOC  WHERE tipCortoDoc NOT IN ('RCD' , 'NS' , 'NR' , 'NINGUNO' , 'OTRO' )");
        tmAD.save();
    }

